import Sidebar from './Sidebar'; // Sidebar Component
import styles from './CoordinatorDashboard.module.css';

const Dashboard = () => {
  return (
    <div className={styles.dashboard}>
      {/* Sidebar */}
      <Sidebar />
      {/* Main Content */}
      <div className={styles.mainContent}>
        <h1>Welcome to the Coordinator Dashboard</h1>
        <p>Here you can manage tours, guides, applications, and more!</p>
        {/* Add your dashboard components like charts, tables, etc. */}
        <div style={{ height: '1500px' }}>
          {/* Example of overflow content to test scrolling */}
          <p>Scroll to see more content...</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
